import React from "react";
import {videoJ} from "./../../img/video.mp4";

const Home = () => {

      return (
       <>
       <div className="titleStyle">
    
       <h1>Home Page</h1>
       <br></br>
       <video width="435" height="390" autoplay>
        <source src={videoJ} type="video/mp4"/>
        
        </video>
    
       </div>
       </>
      )
    }
    
    export default Home;
